A queue is a linear data structure that follows the First-In-First-Out (FIFO) principle, meaning that the element that is inserted first will be removed first. It is similar to a real-life queue, where the person who arrives first gets served first.

In a queue, two primary operations are performed:

1. Enqueue: This operation adds an element to the rear of the queue.
2. Dequeue: This operation removes an element from the front of the queue.

